var tipuesearch = {"pages": [{'title': '關於', 'text': 'https://github.com/mdecycu/cmsit \n \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 \n \n \n 歡迎來到芋圓的網站 \n', 'tags': '', 'url': '關於.html'}, {'title': '家庭作業', 'text': '', 'tags': '', 'url': '家庭作業.html'}, {'title': '任務', 'text': '', 'tags': '', 'url': '任務.html'}, {'title': '1.Solid Edge', 'text': '因為老師分3人一小組，9人一大組要大家分工合作一起利用7個繪圖軟體設計繪圖，然後製作簡報。所以讓我因緣際會分配到了solid edge 這個軟體，故我現在執行任務的首要任務是了解 solid edge\xa0是什麼? \n \n \n \n Solid Edge 是一個包含多款經濟易用的軟體工具的產品組合，可解決產品開發過程的各種問題。 Solid Edge 通過同步建模技術，將直接建模的快速和簡易性與參數化設計的靈活性和可控性相結合。 Solid Edge 按照您要求提交支援雲的設計Solid Edge 提供您需要的雲功能，方便您在不同設備上存取專業 3D CAD，按照您的個人喜好設定即時組態 CAD 環境，並在設計資源以及供應商和客戶之間快速共用資料。 支援雲的 Solid Edge 降低了對 IT 支援的需求。 讓他們騰出更多的時間處理生產效率更高的專案，而不是日常系統維護。 對於需要在辦公室、工廠現場和外出拜訪供應商或客戶時全程掌握設計專案資訊的設計師而言，近年來平板設備的發展令其受益頗多。 \n \n \n \xa01.載\xa0 solid edge 這個軟體，去 這個 網站載。 \n \xa02. 學習\xa0 solid edge \xa0這個軟體的指令及操作，觀看 這個 影片。 \n', 'tags': '', 'url': '1.Solid Edge.html'}, {'title': '2.利用\xa0Solid Edge 繪圖永動機模擬器的零組件(專案一)', 'text': '永動機範例: \n \n \n 1.\xa0 以下是參考onshape Perpetual Motion Simulator 並且使用Solid Edge所畫 \n 組合圖: \n \n 零件 \n 1.軌道 \n \n 2.塔座 \n \n 3.底座 \n \n 以上是我41136103吳裕源及另一位組員伙伴4112321柯程桂於2013/10/23一同繪製。 \n 心得: \n 1.使用者操作性：Solid Edge相對而言比較繪圖，螢幕佈局清晰，功能區分明顯，使初學者也能比較快速地在地上手學習。 \n 2.建模功能：軟體提供了豐富的建模工具和功能，如實體建模、曲面建模、組裝設計等，可以滿足各種不同的設計需求。 \n 3.多種建模方式：Solid Edge支援同步建模和傳統特徵建模，使用者可以根據自己的喜好和專案需求選擇合適的建模方式。 \n 以上這三點是我們利用 Solid Edge 這個軟體繪圖中所得出的使用心得。 \n \xa0簡報製作: \n \xa0 \xa0 \xa0 這個 是我們製作的簡報。 \n 作動模擬影片: \n 影片 \n', 'tags': '', 'url': '2.利用\xa0Solid Edge 繪圖永動機模擬器的零組件(專案一).html'}, {'title': 'wink', 'text': '', 'tags': '', 'url': 'wink.html'}, {'title': '1.wink參考資料', 'text': '學習如何利用 Wink 製作電腦操作流程影片, 並將影片放入個人與分組網頁中. \xa0 \xa0 \n 首先使用者必須了解 Wink 製作影片的功能與 ShareX 相同, 都是依賴 ffmpeg.exe . 意即使用 Wink 之前必須在 Preferences 中先行設定 ffmpeg.exe 所在位置, 否則無法對所建立的專案轉為 mp4 檔案. \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \n 另外, 若擷取關鍵影格的電腦螢幕解析度大於 1008 x 630, 通常建立將影格 resize, 以方便使用者在手機上觀看影片. \n 利用 Wink 建立操作影片的步驟: \n \n 設定 ffmpeg.exe 所在位置, 若使用隨身碟中的可攜程式系統, 可將 ffmpeg.exe 放在 data 目錄中, 並以 wink_ffmpeg.reg 進行設定, 也可將 Wink 的啟動與 start_ipv6.bat 進行整合. \n 開啟 Wink 新專案. \n 每按下一次 Pause 鍵, 可擷取操作過程中的畫面影格 (利用 Zoomit 放大所要強調的操作內容, 並以紅線框列). \n 操作錄製結束後, 從右下方的 Tray 中, 以滑鼠左鍵點選, 在 Wink 圖示中, 以滑鼠右鍵帶出 Finish Capture 按鍵, 點選後即可回到 Wink 專案區. \n 在每一頁影格中加入註解說明 TextBox 之前, 先利用 Project - Resize All Frames 將影格縮小至 1008 x630. \n 完成註解說明後, 可以逐一移動各頁面滑鼠游標位置, 並決定各頁面影片播放時的停留時間.\xa0\xa0 \n 最後以 Render 按鈕進行轉檔, 並利用 View Rendered Output 檢視所建立的操作影片.\xa0 \xa0\xa0 \n \n', 'tags': '', 'url': '1.wink參考資料.html'}, {'title': '2.wink影片錄製', 'text': '\xa0 \xa0 \xa0 \xa0還未錄。 \n', 'tags': '', 'url': '2.wink影片錄製.html'}, {'title': 'w12 作業', 'text': '11/30 機械設計二乙 出席座位表 \n 2b_w12_seat.txt \n 2b stud num seat 41123201 41123202 (3,8) 41123203 (3,7) 41123204 (6,8) 41123205 (2,9) 41123206 (3,4) 41123207 (1,5) 41123208 (2,3) 41123209 (2,6) 41123210 (4,3) 41123211 (6,2) 41123212 (1,7) 41123213 (1,3) 41123214 (4,1) 41123215 (1,4) 41123216 (6,9) 41123217 (6,7) 41123218 (4,5) 41123219 41123220 (1,1) 41123221 (2,2) 41123222 (3,9) 41123223 (3,5) 41123224 (4,2) 41123226 (3,3) 41123227 (3,6) 41123228 41123229 (5,2) 41123230 (2,7) 41123231 (1,2) 41123232 (6,5) 41123233 (2,8) 41123234 41123235 (5,1) 41123236 (5,3) 41123237 (1,9) 41123238 (1,8) 41123239 (4,8) 41123240 (4,4) 41123241 (5,7) 41123243 (5,8) 41123244 41123245 (4,9) 41123246 (5,6) 41123247 (6，3) 41123248 41123249 (5,9) 41123250 (5,5) 41123251 (5,4) 41132222 (6,4) 41136103 (7,3) 41136124 (3,2) 41136126 41136131 \n', 'tags': '', 'url': 'w12 作業.html'}, {'title': 'w15考試', 'text': '圓軌永動機 \n 上課考試: \n 1.繪製底座草圖 \n \n 2.底座 \n \n 3圓軌 \n \n 4.成體 \n \n 5.鋼球 \n \n 課後: \n 成體: \n \n \n 鋼球: \n \n 鋼球繪圖影片: \n 影片 \n 鋼球放上圓軌永動機繪圖影片: \n 影片 \n 圓軌永動機繪圖影片: \n 影片 \n 心得: \n 因為w15是線上隨堂考，所以我畫的比較隨便，我課後又自己在畫了一個比較好的圓軌永動機。至於如何讓鋼球在圓軌上作動還是我現今要努力的課題。 \n 作動模擬影片: \n 影片 \n', 'tags': '', 'url': 'w15考試.html'}, {'title': '專案二', 'text': '三角永動機繪圖 \n \n 作動模擬影片: \n 影片 \n', 'tags': '', 'url': '專案二.html'}, {'title': '上課進度', 'text': '', 'tags': '', 'url': '上課進度.html'}, {'title': 'w4', 'text': '1.建立考試帳號  在w4達成(yes) \n 2.利用replit把github更新並推送更新\xa0 未在w4達成(no)\xa0  w9達成(yes) \n 3.選用繪圖軟體( Solidworks ) \n w4心得: \n 在w4老師教我們建立課堂考試的帳號，我成功達成。在 replit把github更新並推送更新這方面我並沒有在w4完成。 備註:經過不斷的努力及詢問同學，我終於在w9學會推送更新。\xa0 \n', 'tags': '', 'url': 'w4.html'}, {'title': 'W5', 'text': '1.學習使用 CoppeliaSim套件。 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'w6', 'text': '1.進行九人分組\xa0 在w6達成(yes ) \n 2.獲取CoppeliaSim展示用IPv6位址\xa0 未在w6達成(no) \xa0 \n w6心得: \n 在w6老師叫我們分組，我成功分配到第六組。與組員柯程桂一起分配到利用 solid edge 這個繪圖軟體繪圖。 \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '1.學習使用透過localhost方式更新github\xa0 \n 2.獲取新的教室網路設定檔案 \n 3.開始繪製任務一零件 \n w7心得: \n 在w7我和柯程桂兩人開始繪圖，最後完成繪圖，也有完成簡報。 備註:於w9學會利用replit把github更新並推送更新後，成功把圖及簡報推向個人網站。 \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '1.學習使用自架主機維護網站\xa0\xa0 未在w8達成(no)\xa0 \n 2.第一次考試(考兩次，分數平均)\xa0 未在w8達成(no) \xa0 \n w8心得: \n 在w8我身體不舒服所以我沒到課堂上上課，所以我沒有考試。但是於w9有詢問同學，得知老師這堂課非常用心地在教 學習使用自架主機維護網站，未到修課實在太可惜了。 \n \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w9', 'text': '1.期中考(考兩次)\xa0 w9達成(yes) \n 2.期中自評成績表單\xa0 w9達成(yes) \n \n w9心得: \n \n 在w9老師讓我們自評成績及考試。我自評60分，考試考得不太理想。 \n \n', 'tags': '', 'url': 'w9.html'}, {'title': 'W10', 'text': '1.講解wink使用方法 \n', 'tags': '', 'url': 'W10.html'}, {'title': 'w11', 'text': '平面上滾動的鋼球永動模擬器, 也算 perpetual motion simulator (pms) 中的一種: \n \n 2.明日運動會校慶我十分開心，祝虎科43歲生日快樂。 \n \n', 'tags': '', 'url': 'w11.html'}, {'title': 'w12', 'text': '1.填位置座標， 並且按照位置排序出座位表。 未在w12達成(no)\xa0 w13達成(yes) \xa0\xa0 \n w12心得: \n 老師在w12課堂上教我們填位置座標， 並且按照位置排序出座位表，在課堂上沒聽懂，回家看老師的影片摸索也不太懂。 備註:在w13課堂間問同學，終於弄懂了，也在w13補繳了w12的作業。 \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '1.考試點名 \n 備註:在w13課堂裡補繳了w12的作業。 \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '1教師查看每組進度 \n 2.對每位學員網站進行評分 \n w14 心得: \n 在w14課堂裡老師再查看每組進度及個人網站的評分。不幸的老師給我兩個x，但是我不氣餒，最重要的是要改進。我有聽到老師說我在github推上去的那裡並沒有註記我推了甚麼，只有數字，我聽了十分有道理，所以我會加以改進不會再犯。 \n \xa0\xa0 \n', 'tags': '', 'url': 'w14.html'}, {'title': 'W15', 'text': '1.小考一次(分數:20分)\xa0 \xa0 w15達成(yes) \n \n \n 2. 實作 exam\xa0 \xa0\xa0 \n exam 內容: 設計出此\xa0 題目 \xa0 \xa0 \n 步驟1: 基本零組件設計繪圖。 \xa0w15達成(yes) \n 步驟2 : 施力機構設計, 納入軌道下方控制盒中。\xa0 未在w15達成(no) \n 步驟 3: 將軌道、鋼球與簡化後的控制盒輸入 CoppeliaSim。\xa0 未在w15達成(no) \n 步驟 4: 配合控制系統設計, 納入感測器與施力機構或系統。\xa0 未在w12達成(no) \n 步驟 5: 在 localhost 以 IPv6 ZMQ remote API Python 程式, 配合感測器作動對鋼球施力。 \xa0未在w15達成(no) \n 步驟 6: 跨網路對協同組員的場景進行控制模擬。\xa0 未在w15達成(no) \n \n 3.專案二的製作(三角永動機) \n', 'tags': '', 'url': 'W15.html'}, {'title': 'w16', 'text': '1.小考一次(分數:55分)\xa0 \xa0 w16達成(yes) \n \n 2.講解學期總成績分數給分重點 \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w16.html'}, {'title': '教學影片', 'text': '', 'tags': '', 'url': '教學影片.html'}, {'title': '教師', 'text': '9/20\xa0 \xa0 cadlap_網路設定 \n 9/20\xa0 \xa0 replit_github_結合應用說明 \n 9/22\xa0 \xa0 onshape_基本繪圖與轉 STL 進入 coppeliaSim \n 10/11\xa0 w5_2b_onshape_to_coppeliasim \n 10/18\xa0 w6 2b 建立 cad2023 並 import 進入 replit 並將改版推向 github \n 10/18\xa0 w6 2b 說明 pull requests 用法 \n 10/19\xa0 w6 2a 開始九人分組, 各組由建立 cad2023_ag1 倉儲 \n 10/25\xa0 w7 2b 從頭建立 cmsimde 網站之二 \n 10/25\xa0 w7_2b_從頭建立 cmsimde 網站之一 \n 10/27\xa0 w7_2a 以 SSH 連線取下個人倉儲啟動編輯 \n 10/27\xa0 w7_2a 以 SSH 連線取下個人倉儲啟動編輯之二 \n 11/2\xa0 \xa0  w8_2a_s1511_part1 \n 11/3\xa0 \xa0  w8_2a_s1511_part2 \n 11/3\xa0 \xa0  w8_2a_s1511_part3 \n 11/3\xa0 \xa0  w8_2a_s1511_part4 \n 11/29\xa0  w12_2b_1 \n 11/29\xa0  w12_2b_2 \n 12/7\xa0 \xa0  w13_2b_1 \n 12/14\xa0  w14_2b_1 \n 12/14\xa0  w14_2b_2 \n 12/14\xa0  w14_2b_3 \n 12/15\xa0  w14_2a_1 \n 12/15\xa0  w14_2a_2 \n 12/15\xa0  w14_2a_3 \n 12/15\xa0  w14_2a_4 \n', 'tags': '', 'url': '教師.html'}, {'title': '布萊頓', 'text': 'https://en.wikipedia.org/wiki/Python_（程式語言）  123 \n 例子： \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python教學： \n https://docs.python.org/3/tutorial/ \n Python的平衡介紹 \n 縮排（Python採用4個Spaces縮排，以介面執行範圍） \n 變數（ Python 關鍵字 ） \n 註（#單行註解、三單標註或三雙標註標註多行註解） \n 數 (整數 int(), 浮點數 float()) \n 字符串 （字串） \n print (Python 內建函數,  print() 函數式) \n Python是控制流程工具 \n 為了 \n 如果 \n 範圍 \n 開放 \n 讀 \n 清單 \n 元組 \n 字典 \n 功能 \n 嘗試...除了 \n 休息時間 \n 曾經 \n 類別 \n 此頁面示範如何在同一頁面下加入多個線上Ace編輯器與執行按鈕（ practice_html.txt 動態頁面超檔案）。 \n Practice_html.txt 動態頁面超檔案應該可以在啟動 Brython 時，設定分割 .py 檔案放入 downloads/py 目錄中引用。 \n 也所有即將對應的 html 也使用 Brython 產生，然後編寫為 類別 後，在範例匯入時交叉 實例 引用。 \n <!-- 啟動 Brython --> \n<腳本> \n視窗.onload=函數(){ \nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']}); \n} \n</> 腳本 \n 從1累加到100： \n 1加到100 \n 將 iterable 與 iterator 相關說明 ，利用 Brython 與 Ace Editor 整理頁面。 \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n 文件名稱： .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n 跑步   輸出   明確輸出區 清晰的繪圖區 重新載入 \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從1累加到100第2部分： \n 1加到100 cango_三_齒輪 BS蛇 人工智能俄羅斯方塊 旋轉塊 \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n 文件名稱： .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n 跑步   輸出   明確輸出區 清晰的繪圖區 重新載入 \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': '布萊頓.html'}]};